    .then((res)=>{
      setPersonajes(res.data.data.results);
      console.log(res.data.data.results[0]);
    })
    .catch((error)=>{
      console.error(error)
    })
  },[]);


  const verDetalle = (jeje) => {
    setModalVisible(jeje);
  }
  const renderItem = ({ item }) => (
    <TouchableOpacity style={styles.cardContainer} onPress={() => setModalVisible(true)}>
      <Image style={styles.cardImage} source={item.image} />
      <Text style={styles.cardDescription}>{item.title}</Text>
    </TouchableOpacity>
  );
  const closeModal = () => {
    setModalVisible(false);
  };

  return (
    <View style={styles.container}>
      {/* Encabezado de la aplicaci贸n */}
      <View style={styles.header}>
        <Text style={styles.headerText}>Marvel Info</Text>
      </View>

      {/* Cuerpo de la aplicaci贸n */}
      <View style={styles.body}>
        {/* Secci贸n de carta */}

        <TouchableOpacity style={styles.cardContainer} onPress={() => verDetalle(true)}>
          <Image style={styles.cardImage} source={`${personajes[0].thumbnail.path}.${personajes[0].thumbnail.extension}`} />
          <Text style={styles.cardDescription}>Descripci贸n de la carta</Text>
          <Modal animationType="slide" transparent={true} visible={modalVisible}>
            <View style={{ alignItems: 'end', margin: '10vw', height: '40vh', borderWidth: '2px', backgroundColor: 'white', borderRadius: '1%' }}>
              <TouchableOpacity onPress={() => verDetalle(false)}>
                <Text style={{ margin: '10px', textAlign: 'right', alignSelf: 'flex-start' }}>X</Text>
              </TouchableOpacity>
              <Text style={{ margin: '10px', alignSelf: 'center', fontSize: '20px', fontWeight: 'bold' }}>Informacion sobre la carta</Text>

            </View>
          </Modal>
        </TouchableOpacity>

        {/* Secci贸n de arena */}
        <TouchableOpacity style={styles.arenaContainer} onPress={() => navigation.navigate('Game1')}>
                <Text style={styles.arenaText}>Informaci贸n de la Arena</Text>
              </TouchableOpacity>
      </View>
    </View>
  );
};
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#f0f0f0',
  },
  header: {
    backgroundColor: '#3498db',
